script: |
  super -f text -I q5568.spq | sort > q5568.out

inputs:
  - name: q5568.spq
    data: |
      SELECT col2 + + col0 + + ( col0 ) AS col0 FROM tab1 (FORMAT parquet) WHERE + - col2 * + col2 + + + 46 < ( - - col0 - - ( - col1 ) );
  - name: tab1

outputs:
  - name: q5568.out
    data: |
      198
      229
      250
